  }
  function addDoctors(){

    navigate('/addDoctors', { state: {id: location.state} });
  }
  return (
    <React.Fragment>    
    <div><h1>AdminDashboard</h1></div>
    <button type="button" className="btn btn-success btn-lg btn-block">reply the quiries</button>
    <button type="button" className="btn btn-warning btn-lg btn-block" onClick={() => seePatients()}>See the patients</button>
    <button type="button" className="btn btn-secondary btn-lg btn-block" onClick={() => seeDoctors()}>See the doctors </button>
    <button type="button" className="btn btn-info btn-lg btn-block" onClick={() => addDoctors()}>Add Doctor </button>
    <button type="button" className="btn btn-danger btn-lg btn-block" >Remove Doctor </button>
  </React.Fragment>
  )
}
